<template lang="html">
  <div class="dataset-wrap">
    <md-card md-with-hover>
      <md-card-header>
        <md-card-header-text>
          <div class="md-title">Live Connection</div>
          <div class="md-subhead">Port {{ connection.port }}</div>
        </md-card-header-text>
        <div>
          Connected
          <md-icon class="success-icon">check</md-icon>
        </div>

      </md-card-header>
      <md-divider></md-divider>

      <md-card-expand>
        <md-card-actions md-alignment="space-between">
          <div>
            <md-button class="md-accent" to="/liveanalysis">Open</md-button>
            <md-button @click="deleteConnection(connection.port)">Delete</md-button>
          </div>
        </md-card-actions>
      </md-card-expand>
    </md-card>

    <md-snackbar :md-position="position" :md-duration="isInfinity ? Infinity : duration" :md-active.sync="showSnackbar" md-persistent>
      <span>{{ snackbarMsg }}</span>
      <md-button class="md-primary" @click="handleSnackBarShow">Show</md-button>
    </md-snackbar>
  </div>
</template>

<script>
import { apibaseurl } from '@/config/variables.js'

export default {
  props: ['connection'],
  computed: {},
  methods: {
    handleSnackBarShow: function handleSnackBarShow () {
      this.showSnackbar = false
      this.$router.push('/dashboard')
    },
    deleteConnection: async function (port) {
      let app = this
      this.$store.commit('removeLiveTile', { port: port.toString() })
      this.$store.commit('clear_socketData')
      await this.$store.commit('removeConnection')
      fetch(`${apibaseurl}/live-analysis/connection?PORT=${port}`, {
        method: 'DELETE',
        credentials: 'include'
      })
        .then(() => {
          app.$emit('deleted')
        })
        .catch(() => {
          console.error('Unable to delete connection')
        })
    }
  },
  data: function () {
    return {
      showSnackbar: false,
      position: 'center',
      duration: 4000,
      isInfinity: false,
      snackbarMsg: null
    }
  }
}
</script>

